import { Tabs } from 'antd';
import { useNavigate } from 'react-router-dom';
const { TabPane } = Tabs;

const BgAtas = () => { 
  const navigate = useNavigate()
  return (
  <div className="card-container" style={{marginLeft:"56px"}}>
    <Tabs type="card" style={{height: "100vh",width: "300px"}} >
      <TabPane tab="General Report" key="1" >
        <p onClick={() => {navigate ("./Navbar");}}>Content of Tab Pane 1 </p>
      </TabPane>

    </Tabs>
  </div>
);
  }

export default BgAtas;
